import React from 'react';
import { View } from 'react-native';

export default function SnapButton() {
    return (
        <View
            style={{
                position: 'absolute',
                bottom: 0,
                flexDirection: 'row',
                flex: 1,
                width: '100%',
                padding: 20,
                justifyContent: 'space-between'
            }}
        >
            <Text>Hiii POO</Text>
        </View>
    )
}
